import React from 'react';
//Turing
const PersonalityInsights = React.lazy(() => import('./Turing/PersonalityInsights'));
const RegisterUser = React.lazy(() => import('./Turing/RegisterUser'));
const ModifyUser = React.lazy(() => import('./Turing/ModifyUser'));
const Users = React.lazy(() => import('./Turing/Users/Users'));
const SearchUser = React.lazy(() => import('./Turing/SearchUser'));
const User = React.lazy(() => import('./Turing/Users/User'));
//
const Dashboard = React.lazy(() => import('./views/Dashboard'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/', exact: true, name: 'Home' },
  { path: '/dashboard', name: 'Dashboard', component: Dashboard },
//
  { path: '/usuarios', exact: true,  name: 'Usuarios', component: Users },
  { path: '/personality/:id', exact: true, name: 'Perfil do Usuário', component: PersonalityInsights },
  { path: '/personality', name: 'Buscar Usuário', component: SearchUser },
  { path: '/cadastrarusuario', name: 'Cadastrar Usuário', component: RegisterUser },
  { path: '/modify/:id', exact: true, name: 'Modificar Usuário', component: User },
  { path: '/modify', name: 'Buscar Usuário', component:  SearchUser},

];

export default routes;
